import React, {Component} from 'react';
import Block from "../../components/Block";
import communityStyle from './index.module.css';
import {Affix, Button, Space} from "antd";
import Banner from "../../components/Banner";
import by2021 from '../../images/2021.png';
import dream from '../../images/dream.png'
import autumn from '../../images/mid-autumn.jpg';
import {createFromIconfontCN} from "@ant-design/icons";

const RankIcon=createFromIconfontCN({
    scriptUrl:'//at.alicdn.com/t/font_2461384_cuekfwxolk9.js'
});

class Community extends Component {

    render() {
        return (
            <>
                <Affix className={communityStyle.affix} offsetTop={10}>
                    <Button type='' icon={<RankIcon type='icon-paihangbang'/>} className={communityStyle.rank}><br/>排<br/>行<br/>榜</Button>
                </Affix>
                <div className={communityStyle.container}>
                    <Banner imgs={[autumn, by2021, dream]}/>
                    <Space direction='vertical' size={20}>
                        <Space size={20}>
                            <Block/>
                            <Block/>
                            <Block/>
                        </Space>
                        <Space size={20}>
                            <Block/>
                            <Block/>
                            <Block/>
                        </Space>
                    </Space>
                </div>
            </>
        );
    }
}

export default Community;
